import React from "react";
import { Alert } from "antd";

const errorTrades = ["AGD896", "ADS888"];

class Alertlist extends React.Component {
  render() {
    return (
      <div>
        {errorTrades.map(trade => (
          <Alert
            style={{ marginTop: 8 }}
            message={`Error detected for trade ${trade}.`}
            type="warning"
            showIcon
          ></Alert>
        ))}
      </div>
    );
  }
}
export default Alertlist;
